from models import Merchant, Discount
import random
import string

# Seed with 5 merchants and 2 discounts each
Discount.delete().execute()
Merchant.delete().execute()

merchants = {
    "Yong Tau Foo & Laksa": "data:image/jpeg;base64,",
    "Chinese Cooked Food": "data:image/jpeg;base64,",
    "Japanese": "data:image/jpeg;base64,",
    "Snacks & Fried Kway Teow": "data:image/jpeg;base64,",
    "Western": "data:image/jpeg;base64,"
}

print(len(merchants))
for merchant, img in merchants.items():
    merchant = Merchant(
        name=merchant, type=random.randint(1, 2), image=img)
    merchant.save()

    for j in range(1, 3):
        discount = Discount.create(merchant=merchant, title=f"Title {j} of {merchant}", code="".join(
            [random.choice(string.ascii_letters) for _ in range(7)]), description="some description")
        discount.save()
